    [],nt"organization": {ntt"description": "The Arctic Landscape Conservation
    Cooperative (ALCC) supports conservation in the arctic by providing [applied science](http://arcticlcc.org/projects/)
    and [tools](http://arcticlcc.org/products/) to land managers and policy makers.
    It is a self-directed partnership that functions through a structure of at-large
    partners, a core staff, and a steering committee of cooperating agencies and organizations.
    Its [geographic scope](http://arcticlcc.org/projects/geospatial-data/arctic-lcc-boundaries/)
    ranges across North America from Alaska to Labrador. The Alaska portion encompasses
    three eco-regions: the Brooks Range, the Arctic Foothills, and the Arctic Coastal
    Plain.",ntt"title": "Arctic Landscape Conservation Cooperative",ntt"created":
