    [],nt"num_tags": 0,nt"name": "aquabase-fws-2012",nt"isopen": false,nt"url":
    null,nt"notes": "The distribution and abundance of fishes in Alaska Arctic
    is poorly known, especially for resident species. Only a few arctic watersheds have
    been the subject of fisheries or water quality investigations. Such information,
    when it exists, is often difficult to locate because it typically does not exist
    in digital form. The AquaBase project compiles and digitizes disparate fish and
    water quality data sets, and serves as a comprehensive information source for use
    in habitat assessment, modeling activities and for planning industrial activities
    The geographic coverage of AquaBase includes all the North Slope drainages located
    within Arctic NWR and eastward to the Kuparuk River (Prudhoe Bay region).",nt"owner_org":
